Fig. 6 shows the room-temperature compressive stress–strain curve of bulk Al0.75FeNiCrCo, Al0.75FeNiCr and Al0.75FeNiCrCoTi0.25 alloys after SPS. The yield strength (σ

   y
), compressive strength (σ

   max
) and strain-to-failure (ε

   f
) and Vickers hardness values of the studied alloys are given in 
Table 5. The compressive strength of Al0.75FeNiCrCo, Al0.75FeNiCr, and Al0.75FeNiCrCoTi0.25 are 2221, 2184 and 2376MPa, respectively. The average Vickers hardness values of Al0.75FeNiCrCo, Al0.75FeNiCr and Al0.75FeNiCrCoTi0.25 have been measured as 577, 556 and 609Hv, respectively. The high strength and hardness of these investigated alloys is possibly attributed to solid-solution strengthening caused by Al or/and Ti atoms with larger atomic radius than the other constituent elements, twin-boundary strengthening, as well as grain-boundary strengthening owing to ultra-fine grains [58,59]. With Co removal, the compressive strength of Al0.75FeNiCr decrease slightly compared to that of Al0.75FeNiCrCo, and the strain-to-failure of the former is slightly lower than the later. With Ti addition, Al0.75FeNiCrCoTi0.25 displays a higher compressive strength and a slightly lower strain-to-failure that that of Al0.75FeNiCrCo. Furthermore, Al0.75FeNiCrCoTi0.25 shows the highest Vickers hardness among the three investigated alloys.
